import React from 'react';
import { useNavigate } from 'react-router-dom';
import { ArrowLeft, CheckCircle, Calendar, AlertCircle, Bell } from 'lucide-react';

const Notifications = ({ theme, notificationsList }) => {
  const navigate = useNavigate();
  const isDark = theme === 'dark';

  // Mock data with 'eventId' added for redirection
  const defaultNotifications = [
    { 
      id: 1, 
      type: 'success', // 'success' types go to Ticket
      title: 'Registration Approved', 
      desc: "Your registration for 'AI & Future Tech Workshop' has been confirmed. Tap to view ticket.", 
      time: "2h ago", 
      eventId: 1, // Need this ID to find the event
      icon: <CheckCircle size={24} color="#5c5cfc" />, 
      bgColor: '#eef2ff' 
    },
    { 
      id: 2, 
      type: 'new', // others go to Event Details
      title: 'New Event Added', 
      desc: "'Inter-College Music Battle' is now open for registration. Check details.", 
      time: "5h ago", 
      eventId: 2,
      icon: <Calendar size={24} color="#22c55e" />, 
      bgColor: '#dcfce7' 
    },
    { 
      id: 3, 
      type: 'update',
      title: 'Event Updated', 
      desc: "The location for 'University Basketball Finals' has been changed.", 
      time: "Yesterday", 
      eventId: 3,
      icon: <AlertCircle size={24} color="#eab308" />, 
      bgColor: '#fef9c3' 
    },
    { 
      id: 4, 
      type: 'reminder',
      title: 'Reminder', 
      desc: "Don't forget, 'AI & Future Tech Workshop' starts tomorrow at 09:00 AM.", 
      time: "2d ago", 
      eventId: 1,
      icon: <Bell size={24} color="#ef4444" />, 
      bgColor: '#fee2e2' 
    }
  ];

  // Use passed props if available, otherwise use default
  const list = notificationsList && notificationsList.length > 0 ? notificationsList : defaultNotifications;

  // HANDLER: Decides where to go based on notification type
  const handleNotificationClick = (item) => {
    if (!item.eventId) return;

    if (item.type === 'success' || item.title.includes('Approved') || item.title.includes('Confirmed')) {
      // If registration is approved, go to TICKET
      navigate(`/ticket-confirmation/${item.eventId}`);
    } else {
      // Otherwise, go to EVENT DETAILS
      navigate(`/event-details/${item.eventId}`);
    }
  };

  const styles = {
    container: {
      padding: '40px',
      backgroundColor: isDark ? '#0f172a' : '#f8fafc',
      minHeight: '100%',
      fontFamily: "'Inter', sans-serif",
      maxWidth: '800px',
      margin: '0 auto'
    },
    header: {
      display: 'flex',
      alignItems: 'center',
      gap: '15px',
      marginBottom: '30px'
    },
    backBtn: {
      cursor: 'pointer',
      padding: '8px',
      borderRadius: '50%',
      backgroundColor: 'transparent',
      border: 'none',
      color: isDark ? '#fff' : '#1e293b'
    },
    title: {
      fontSize: '24px',
      fontWeight: '800',
      color: isDark ? '#fff' : '#1e293b'
    },
    listContainer: {
      display: 'flex',
      flexDirection: 'column',
      gap: '16px'
    },
    card: {
      backgroundColor: isDark ? '#1e293b' : '#fff',
      padding: '20px',
      borderRadius: '16px',
      display: 'flex',
      gap: '20px',
      alignItems: 'flex-start',
      boxShadow: '0 4px 6px rgba(0,0,0,0.02)',
      border: isDark ? '1px solid #334155' : '1px solid #e2e8f0',
      cursor: 'pointer',
      transition: 'transform 0.2s, box-shadow 0.2s'
    },
    iconBox: (bg) => ({
      width: '50px',
      height: '50px',
      borderRadius: '12px',
      backgroundColor: isDark ? '#334155' : bg,
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      flexShrink: 0
    }),
    content: {
      flex: 1
    },
    rowTop: {
      display: 'flex',
      justifyContent: 'space-between',
      marginBottom: '4px'
    },
    mainTitle: {
      fontSize: '16px',
      fontWeight: '700',
      color: isDark ? '#fff' : '#1e293b'
    },
    time: {
      fontSize: '12px',
      color: '#94a3b8',
      fontWeight: '500'
    },
    subTitle: {
      fontSize: '14px',
      fontWeight: '600',
      color: '#6366f1',
      marginBottom: '6px'
    },
    desc: {
      fontSize: '14px',
      color: '#64748b',
      lineHeight: '1.5'
    }
  };

  return (
    <div style={styles.container}>
      
      {/* HEADER */}
      <div style={styles.header}>
        <button style={styles.backBtn} onClick={() => navigate(-1)}>
          <ArrowLeft size={24} />
        </button>
        <h1 style={styles.title}>Notifications</h1>
      </div>

      {/* NOTIFICATION LIST */}
      <div style={styles.listContainer}>
        {list.map((item) => (
          <div 
            key={item.id} 
            style={styles.card}
            onClick={() => handleNotificationClick(item)} // <--- ADDED CLICK HANDLER
            onMouseEnter={(e) => {
              e.currentTarget.style.transform = 'translateY(-2px)';
              e.currentTarget.style.boxShadow = '0 10px 15px rgba(0,0,0,0.05)';
            }}
            onMouseLeave={(e) => {
              e.currentTarget.style.transform = 'translateY(0)';
              e.currentTarget.style.boxShadow = '0 4px 6px rgba(0,0,0,0.02)';
            }}
          >
            {/* ICON */}
            <div style={styles.iconBox(item.bgColor || '#eef2ff')}>
              {item.icon || <Bell size={24} color="#5c5cfc"/>}
            </div>

            {/* CONTENT */}
            <div style={styles.content}>
              <div style={styles.rowTop}>
                <span style={styles.mainTitle}>Event Detail</span>
                <span style={styles.time}>{item.time}</span>
              </div>
              
              <div style={styles.subTitle}>{item.title}</div>
              
              <div style={styles.desc}>
                {item.desc}
              </div>
            </div>
          </div>
        ))}
      </div>

    </div>
  );
};

export default Notifications;
